//获取url参数
function getQueryString(name) {
	var queryString = new RegExp("(^|&)" + name + "=([^&]*)(&|$)", "i");
	var r = window.location.search.substr(1).match(queryString);
	if (r != null) return unescape(r[2]); return null;
}

//获取url参数
function clearCookie(name) {
	//获取当前时间 
	var date=new Date(); 
	//将date设置为过去的时间 
	date.setTime(date.getTime()-10000); 
	//将winNum这个cookie删除
	document.cookie=""+ name +"=00; expires="+date.toGMTString();
}

//获取cookie
function gainCookie(name) {
	var resCookie=document.cookie;
	var arrCookie=resCookie.split("; ");
	//遍历cookie数组，处理每个cookie对 
	for(var i=0;i<arrCookie.length;i++){ 
		var arr=arrCookie[i].split("="); 
		//找到名称为userId的cookie，并返回它的值 
		if(name==arr[0]){ 
			return arr[1]; 
			break;
		} 
	}
}

